import React from "react";
import "./ProjSection2.scss";

const ProjSection2 = () => {
  return (
    <div className="pt-16 h-full">
      <h1 className="text-4xl font-bold text-center underline">Our Projects</h1>
      <div className="projsection2container pt-10 grid grid-cols-3 space-x-6"></div>
    </div>
  );
};

export default ProjSection2;
